import "./Dashbord.css";
import download from "../images/download.png";
import slogo from "../images/shlogo.jpg";
import user from "../images/user.png";
// import axios from "axios";
// import { useEffect, useState } from "react";

function Dashbord() {
  return (
    <div>
      <div className="flex p-9  bg-gray-700 ">
        <img src={slogo} alt="img" className="h-20  w-20  rounded-3xl" />
        <div className="px-5 py-5  text-5xl ">
          <h1>
            Society<span>HUB</span>
          </h1>
        </div>
      </div>
      <div className="main  flex">
        <div className="flex flex-col bg-gray-500  w-80">
          <div id="img_nav">
            <img src={user} alt="img" className="imgs h-40 ml-16  mt-10" />
            <p className="text-4xl  ml-25 ">Ketan</p>
          </div>
          <div>View Notice</div>
          <div>Add Complain</div>
        </div>
        <div className="main_dash">
          Dash Board
          <div>
            <div>
              <section><img src={download}  alt="" /></section>
              <section>User Name</section>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashbord;
